css:
@-moz-document url-prefix("https://projecteuler.net/") {
body {
  background: #ECEFD9;
}
body #header {
  background: #ECEFD9;
  box-shadow: 0 2px 5px #eee;
}
body #container {
  background: #ECEFD9;
  color: #000;
}
body #container .problem_content {
  background: #F6F4E9;
  color: #720A13;
  border: solid 1px #aaa;
}
body #container .grid tr {
  background: #F6F4E9;
}
body #container .grid tr a {
  color: #720A13;
}
body #container .grid tr .age_hours {
  color: #613305;
}
body #container #progress_page .problem_unsolved {
  background: #F6F4E9;
}

}
